      description: "description of video 3"
    },
    {
      _id: 4,
      video_src: vid,
      Channel: "prod",
      title: "video 4",
      Uploader: "abc",
      description: "description of video 4"
    }
  ]
  return (
    <div>
      watchHistory
    </div>
  )
}

export default WatchHistory
